import React from 'react';
import logo from './logo.svg';
import './App.css';

function HiddenCode() {
  //unix timestamp
  let code = Math.floor(Math.random()*10000);

  return (
    <pre className='HiddenCode'>
      `${code}`
    </pre>
  )
}

function Welcome() {
  return (
    <div className='Welcome'>
      Welcome to the game.
    </div>
  )
}

function AccessCode() {
// 
  return (
    <form className='AccessCode'>
      <input type='text' placeholder='Access Code' />
      <button>Enter</button>
    </form>
  )
}

function App() {
  return (
    <div className='App'>
      <HiddenCode />
      <div className='Welcome'>Welcome to the game.</div>
      <AccessCode />
    </div>
  );
}

export default App;
